(499, 9, 26, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Bagian Ip address yang berfungsi menunjukan alamat jaringan adalah ...</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Host Id</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Net Id</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. SSH Id</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. NIC</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. TCP</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', ''),
(500, 9, 27, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Sebuah komputer memiliki IP Address 172.168.1.0 memiliki netmask default ...</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. 255.255.255.0</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. 255.255.0.0</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. 255.0.0.0</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. 255.255.255.255</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. 0.255.255.255</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', ''),
(501, 9, 28, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Sebuah komputer yang menyediakan layanan tertentu dalam jaringan adalah ...</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Client</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Server</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Router</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Switch</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Access Point</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', '');
INSERT INTO `soal` (`id_soal`, `id_mapel`, `nomor`, `soal`, `jenis`, `pilA`, `pilB`, `pilC`, `pilD`, `pilE`, `jawaban`, `file`, `file1`, `fileA`, `fileB`, `fileC`, `fileD`, `fileE`) VALUES
(502, 9, 29, '<p class=\"Normal tm5\"><span class=\"tm6\">Jika IP Address sebuah komputer diberikan 191.168.0.100, maka IP Address ini termasuk dalam kelas&hellip;</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">A. A&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">B. B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">C. C. </span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">D. D</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">E. E</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', ''),
(503, 9, 30, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Ip Address sebuah komputer diberikan 10.10.10.1 maka netmask defaultnya adalah ...</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. 255.255.255.0</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. 255.255.0.255</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. 255.0.0.0</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. 255.255.0.0</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. 255.255.255.255</span></p>', 1, '', '', '', '', '', 'C', '', '', '', '', '', '', ''),
(504, 9, 31, '<p class=\"Normal tm5\"><span class=\"tm6\">Aturan baku / standar yang digunakan untuk dapat saling berkomunikasi antar perangkat jaringan / telekomunikasi disebut dengan&hellip;</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">A. Tata tertib jaringan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">B. Undang-undang jaringan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">C. Protokol jaringan</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">D. Etika Jaringan</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">E. Sandi Jaringan</span></p>', 1, '', '', '', '', '', 'C', '', '', '', '', '', '', ''),
(505, 9, 32, '<p class=\"Normal tm5\"><span class=\"tm6\">Tanda gembok</span><span class=\"tm6\">&nbsp;dibawah ini maksudnya adalah &hellip;</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\"> <img src=\"file:////tmp/tmjCLFD5/0000000a.tmp/img00002.PNG\" alt=\"\" width=\"218\" height=\"58\" hspace=\"12\" /><img src=\"data:image/png;base64,\" /></span></p>\r\n<p class=\"Normal tm8\"><span class=\"tm6\">A. Kabel LAN tidak tersambung&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p class=\"Normal tm8\"><span class=\"tm6\">B. Firewall diaktifkan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p class=\"Normal tm8\"><span class=\"tm6\">C. Jaringan tidak terkoneksi</span></p>\r\n<p class=\"Normal tm8\"><span class=\"tm6\">D. LAN Card tidak terpasang</span></p>\r\n<p class=\"Normal tm8\"><span class=\"tm6\">E. Komputer tidak dalam jaringan</span></p>', 1, '', '', '', '', '', 'A', '', '', '', '', '', '', ''),
(506, 9, 33, '<p class=\"Normal tm5\"><span class=\"tm6\">Pesan Request Time Out berarti ...</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">A. Jaringan terhubung dengan baik</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">B. Jaringan tidak terhubung</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">C. Permintaan untuk memutuskan koneksi</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">D. Jaringan terhubung tapi sering putus</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">E. Permintaan untuk keluar dari jaringan</span></p>', 1, '', '', '', '', '', 'C', '', '', '', '', '', '', ''),
(507, 9, 34, '<p class=\"Normal tm5\"><span class=\"tm6\">Subnet mask dari 192.168.1.1/26 adalah ...</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">A. 255.255.255.128</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">B. 255.255.255.192</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">C. 255.255.255.224</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">D. 255.255.255.240</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">E. 255.255.255.248</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', ''),
(508, 9, 35, '<p class=\"Normal tm5\"><span class=\"tm6\">Jarak maksimal pengguanaan media kabel UTP jaringan adalah ...</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">A. 20 m</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">B. 40 m</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">C. 60 m</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">D. 80 m</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">E. 100 m</span></p>', 1, '', '', '', '', '', 'E', '', '', '', '', '', '', ''),
(509, 9, 36, '<p class=\"Normal tm5\"><span class=\"tm6\">Perintah yang digunakan untuk mengetahui konfigurasi IP Address di CMD adalah ...</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">A. ipconfig</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">B. ifconfig</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">C. configsis</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">D. network</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">E. nslookup</span></p>', 1, '', '', '', '', '', 'A', '', '', '', '', '', '', ''),
(510, 9, 37, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Salah Satu fiture acces point yang berfungsi menyebarkan sinyal Wireles adalah &hellip;.</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Acces Point </span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Multi SSID</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Repeater</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Client</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Router</span></p>', 1, '', '', '', '', '', 'A', '', '', '', '', '', '', ''),
(511, 9, 38, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Salah Satu fitureAcces Point yang berfungsi menerima Sinyal adalah &hellip;.</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Acces Point </span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Multi SSID</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Repeater</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Client</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Router</span></p>', 1, '', '', '', '', '', 'D', '', '', '', '', '', '', ''),
(512, 9, 39, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Salah Satu fitureAcces Point yang berfungsi meneruskan Sinyal adalah &hellip;.</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Acces Point </span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Multi SSID</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Repeater</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Client</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Router</span></p>', 1, '', '', '', '', '', 'C', '', '', '', '', '', '', ''),
(513, 9, 40, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Salah Satu fitureAcces Point yang berfungsi membuat SSID lebih dari satu adalah &hellip;.</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Acces Point </span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Multi SSID</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Repeater</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Client</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Router</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', '');
